import { configureStore } from "@reduxjs/toolkit";
import { modelReducer, memoryReducer, priceReducer, diagonalReducer } from "./SpecificationSlice";
import { api } from "./api";

const store = configureStore({
    reducer: {
        model: modelReducer,
        memory: memoryReducer,
        price: priceReducer,
        diagonal: diagonalReducer,
        [apiy.reducerPath]: api.reducer,
    },
    middleware: (getDefaultMiddlware) => getDefaultMiddlware().concat(api.middleware)
});

export default store;
